package com.rison.traffic.Application

import com.rison.traffic.util.{DateUtils, SparkUtils}
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.rdd.RDD
import org.apache.spark.{SparkConf, SparkContext}

/**
 * @author : Rison 2021/9/28 下午2:45
 *         6. 车辆碰撞
 *         区域碰撞，查询两个区域同时出现的车辆和经过的卡扣信息
 */
object AreaCollisionApplication {
  val area1 = "01"
  val area2 = "02"

  def main(args: Array[String]): Unit = {
    val sparkConf = new SparkConf()
    sparkConf.setAppName(this.getClass.getSimpleName.stripSuffix("$"))
    SparkUtils.setMaster(sparkConf)
    val sc: SparkContext = SparkContext.getOrCreate(sparkConf)

    //获取当天全部的卡扣车流量数据
    val monitorCarFlowRDD: RDD[String] = sc.textFile("data/monitor_flow_action")
    monitorCarFlowRDD.cache()

    //全部车辆id/卡扣/区域id/时间 信息 (carId, monitorId, areaId, time)
    val carAreaTimeRDD: RDD[(String, String, String, String)] = monitorCarFlowRDD.flatMap(_.split("\n"))
      .map(
        line => {
          val arr: Array[String] = line.split("\t")
          (arr(3), arr(1), arr(7), arr(4))
        }
      )

    //区域1过车数据 (carId)
    val area1CarRDD: RDD[(String, String)] = carAreaTimeRDD
      .filter(_._3.equals(area1))
      .map(data => (data._1, data._1))
      .distinct()

    //区域2过车数据 (carId)
    val area2CarRDD: RDD[(String, String)] = carAreaTimeRDD
      .filter(_._3.equals(area2))
      .map(data => (data._1, data._1))
      .distinct()

    //Join同时通过区域1和区域2的车辆
    val joinArea1AndArea2CarRDD: RDD[String] = area1CarRDD.join(area2CarRDD)
      .map(_._1)
      .distinct()

    //广播区域共同过车数据
    val carIds: Array[String] = joinArea1AndArea2CarRDD.collect()
    val carIdsBroadcast: Broadcast[Array[String]] = sc.broadcast(carIds)

    //过滤，得到包含共同通过的过车当天行车轨迹
    val carTrackRDD: RDD[(String, String)] = carAreaTimeRDD
      .filter {
        case (carId, monitorId, areaId, time) => carIds.contains(carId)
      }
      .map {
        case (carId, monitorId, areaId, time) => (carId, (monitorId, areaId, time))
      }
      .groupByKey()
      .map {
        case (carId, arr) => {
          val list: List[(String, String, String)] = arr.toList.sortWith(
            (x, y) => DateUtils.getTimeStringToLong(x._3) < DateUtils.getTimeStringToLong(y._3)
          )
          (carId, list.toStream.map(x => x._1 + ":" + x._2).mkString("->"))
        }
      }

    carTrackRDD.collect().foreach(println)
    monitorCarFlowRDD.unpersist()
    sc.stop()
  }

}

